import React from 'react'
import styled from 'styled-components'

function Home(){
    const HomeWrapper = styled.div`
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    width: 100%;
    height: 100%;
    `
    return (
        <HomeWrapper>
        </HomeWrapper>
    )
}

export default Home
